Самые вкусные соединения:
- бекон, красный лук, помидор;
- 4 сыра - моцарелла, Фета, пармезан, чедер;
- свежие шампиньоны, красный лук, помидор;
- консервированный тунец, кукуруза;

Самое вкусное с антипасти:
- Картошка кладется на соус, затем моцарелла, бекон, помидор; 
- батат кладется на соус, затем моцарелла, консервированный артишок, немого брокколи;
- баклажаны можно класть на моцареллу, сверху Фета и помидоры, потереть немного часнока;
